def eulerian_num(n, m, memo={}):
    if (n, m) in memo:
        return memo[(n, m)]
    if n == 0 and m == 0:
        return 1
    if m < 0 or m >= n:
        return 0
    res = (n - m) * eulerian_num(n-1, m-1, memo) + (m + 1) * eulerian_num(n-1, m, memo)
    memo[(n, m)] = res
    return res

