def find_solution(a, b, n):
    def extended_gcd(a, b):
        if b == 0:
            return a, 1, 0
        d, x1, y1 = extended_gcd(b, a % b)
        x, y = y1, x1 - (a // b) * y1
        return d, x, y
    d, x, y = extended_gcd(a, b)
    if n % d != 0:
        return None
    x *= n // d
    y *= n // d
    return (x, y)

