def is_majority(arr, n, target):
    def find_first(arr, n, target):
        low, high = 0, n-1
        first = -1
        while low <= high:
            mid = (low + high) // 2
            if arr[mid] == target:
                first = mid
                high = mid - 1
            elif arr[mid] < target:
                low = mid + 1
            else:
                high = mid - 1
        return first

    def find_last(arr, n, target):
        low, high = 0, n-1
        last = -1
        while low <= high:
            mid = (low + high) // 2
            if arr[mid] == target:
                last = mid
                low = mid + 1
            elif arr[mid] < target:
                low = mid + 1
            else:
                high = mid - 1
        return last

    first = find_first(arr, n, target)
    if first == -1:
        return False
    last = find_last(arr, n, target)
    return (last - first + 1) > n / 2

assert is_majority([1, 2, 3, 3, 3, 3, 10], 7, 3) == True

def get_total_number_of_sequences(m, n):
    dp_prev = [0] * (m + 1)
    for v in range(1, m + 1):
        dp_prev[v] = 1
    for _ in range(2, n + 1):
        dp_curr = [0] * (m + 1)
        for v in range(1, m + 1):
            dp_curr[v] = sum(dp_prev[u] for u in range(1, v // 2 + 1))
        dp_prev = dp_curr
    return sum(dp_prev[1:])

