def get_total_number_of_sequences(n, m):
    from functools import lru_cache
    @lru_cache(None)
    def dfs(length, prev):
        if length == 0:
            return 1
        total = 0
        for num in range(prev * 2, m + 1):
            total += dfs(length - 1, num)
        return total
    total = 0
    for start in range(1, m + 1):
        total += dfs(n - 1, start)
    return total

assert get_total_number_of_sequences(10, 4) == 4

def max_sub_array_sum_repeated(arr, n, k):
    def kadane(arr):
        max_current = max_global = arr[0]
        for num in arr[1:]:
            max_current = max(num, max_current + num)
            max_global = max(max_global, max_current)
        return max_global

    max_kadane = kadane(arr)
    total_sum = sum(arr)

    if k == 1:
        return max_kadane
    else:
        max_prefix = current = arr[0]
        for num in arr[1:]:
            current += num
            max_prefix = max(max_prefix, current)

        max_suffix = current = arr[-1]
        for num in reversed(arr[:-1]):
            current += num
            max_suffix = max(max_suffix, current)

        if total_sum > 0:
            return max(max_kadane, max_prefix + max_suffix + (k-2)*total_sum)
        else:
            return max(max_kadane, max_prefix + max_suffix)

