def get_max_sum(n, memo={}):
    if n in memo:
        return memo[n]
    if n == 0:
        return 0
    sum_val = get_max_sum(n//2, memo) + get_max_sum(n//3, memo) + get_max_sum(n//4, memo) + get_max_sum(n//5, memo)
    memo[n] = max(sum_val, n)
    return memo[n]

assert get_max_sum(60) == 106

def get_max_sum(n, memo={}):
    if n in memo:
        return memo[n]
    max_sum = n
    for k in range(2, 6):
        if n >= k:
            base = n // k
            remainder = n % k
            parts = [base + 1] * remainder + [base] * (k - remainder)
            total = sum(get_max_sum(part, memo) for part in parts)
            if total > max_sum:
                max_sum = total
    memo[n] = max_sum
    return max_sum

assert get_max_sum(60) == 106

