def comb_sort(lst):
    gap = len(lst)
    shrink = 1.3
    sorted_flag = False
    while gap > 1 or not sorted_flag:
        gap = int(gap / shrink)
        if gap < 1:
            gap = 1
        sorted_flag = True
        for i in range(len(lst) - gap):
            if lst[i] > lst[i + gap]:
                lst[i], lst[i + gap] = lst[i + gap], lst[i]
                sorted_flag = False
    return lst

