def is_undulating(n):
    s = str(n)
    if len(s) < 2:
        return False
    unique = set(s)
    if len(unique) != 2:
        return False
    first, second = s[0], next(iter(unique - {s[0]}))
    for i, c in enumerate(s):
        if i % 2 == 0 and c != first:
            return False
        elif i % 2 == 1 and c != second:
            return False
    return True

assert is_undulating(1212121) == True

