def amicable_numbers_sum(n):
    def sum_divisors(x):
        total = 1
        for i in range(2, int(x**0.5) + 1):
            if x % i == 0:
                total += i
                if i != x // i:
                    total += x // i
        return total
    amicables = set()
    for a in range(2, n + 1):
        b = sum_divisors(a)
        if b != a and b <= n:
            if sum_divisors(b) == a:
                amicables.add(a)
                amicables.add(b)
    return sum(amicables)

assert amicable_numbers_sum(999) == 504

