def find_even_pair(lst):
    evens = sum(1 for x in lst if x % 2 == 0)
    odds = len(lst) - evens
    return (evens * (evens - 1) // 2) + (odds * (odds - 1) // 2)

assert find_even_pair([5, 4, 7, 2, 1]) == 4

def find_even_pair(lst):
    count = 0
    n = len(lst)
    for i in range(n):
        for j in range(i+1, n):
            if lst[i] % 2 == lst[j] % 2:
                count += 1
    return count

