from collections import Counter

def get_pairs_count(lst, target):
    freq = Counter(lst)
    count = 0
    for x in freq:
        y = target - x
        if y in freq:
            if x < y:
                count += freq[x] * freq[y]
            elif x == y:
                count += freq[x] * (freq[x] - 1) // 2
    return count

